unsigned char getPixel(unsigned char imageId, unsigned int xCoord, unsigned int yCoord) {
	volatile unsigned char colIndex = xCoord/8;		// Create Column index
	volatile unsigned char bitIndex = xCoord % 8;	// Create bitIndex
	volatile unsigned char pixel;
	//volatile unsigned int address;
	switch(imageId) {
		case 0:
			//pixel = pgm_read_byte(&(num0[yCoord][colIndex]));
			pixel = num0[yCoord][colIndex];
			break;
		case 1:
			//pixel = pgm_read_byte(&(num1[yCoord][colIndex]));
			pixel = num1[yCoord][colIndex];
			break;
		case 2:
			//pixel = pgm_read_byte(&(num2[yCoord][colIndex]));
			pixel = num2[yCoord][colIndex];
			break;
		case 3:
			//pixel = pgm_read_byte(&(num3[yCoord][colIndex]));
			pixel = num3[yCoord][colIndex];
			break;
		case 4:
			//pixel = pgm_read_byte(&(num4[yCoord][colIndex]));
			pixel = num4[yCoord][colIndex];
			break;
		case 5:
			//pixel = pgm_read_byte(&(num5[yCoord][colIndex]));
			pixel = num5[yCoord][colIndex];
			break;
		case 6:
			//pixel = pgm_read_byte(&(num6[yCoord][colIndex]));
			pixel = num6[yCoord][colIndex];
			break;
		case 7:
			//pixel = pgm_read_byte(&(num7[yCoord][colIndex]));
			pixel = num7[yCoord][colIndex];
			break;
		case 8:
			//pixel = pgm_read_byte(&(num8[yCoord][colIndex]));
			pixel = num8[yCoord][colIndex];
			break;
		case 9:
			//pixel = pgm_read_byte(&(num9[yCoord][colIndex]));
			pixel = num9[yCoord][colIndex];
			break;
		case MAZE0_IMAGE_ID:
			//pixel = pgm_read_byte(&(maze0[yCoord][colIndex]));
			pixel = maze0[yCoord][colIndex];
			break;
		case MAZE0_PATH_ID:
			//pixel = pgm_read_byte(&(maze0Path[yCoord][colIndex]));
			pixel = maze0Path[yCoord][colIndex];
			break;
		case MAZE1_IMAGE_ID:
			//pixel = pgm_read_byte(&(maze1[yCoord][colIndex]));
			pixel = maze1[yCoord][colIndex];
			break;
		case MAZE1_PATH_ID:
			//pixel = pgm_read_byte(&(maze1Path[yCoord][colIndex]));
			pixel = maze1Path[yCoord][colIndex];
			break;
		case MAZE2_IMAGE_ID:
			//pixel = pgm_read_byte(&(maze2[yCoord][colIndex]));
			pixel = maze2[yCoord][colIndex];
			break;
		case MAZE2_PATH_ID:
			//pixel = pgm_read_byte(&(maze2Path[yCoord][colIndex]));
			pixel = maze2Path[yCoord][colIndex];
			break;
		case MAZE3_IMAGE_ID:
			//pixel = pgm_read_byte(&(maze3[yCoord][colIndex]));
			pixel = maze3[yCoord][colIndex];
			break;
		case MAZE3_PATH_ID:
			//pixel = pgm_read_byte(&(maze3Path[yCoord][colIndex]));
			pixel = maze3Path[yCoord][colIndex];
			break;
		case MAZE4_IMAGE_ID:
			//pixel = pgm_read_byte(&(maze4[yCoord][colIndex]));
			pixel = maze4[yCoord][colIndex];
			break;
		case MAZE4_PATH_ID:
			//pixel = pgm_read_byte(&(maze4Path[yCoord][colIndex]));
			pixel = maze4Path[yCoord][colIndex];
			break;

		case SG_BACKGROUND_IMAGE_ID:
			//pixel = pgm_read_byte(&(snakeGameBackground[yCoord][colIndex]));
			pixel = snakeGameBackground[yCoord][colIndex];
			break;
		case MAIN_MENU_BUTTON_ID:
			//pixel = pgm_read_byte(&(mainMenuButton[yCoord][colIndex]));
			pixel = mainMenuButton[yCoord][colIndex];
			break;
		case HS_SNAKE_BUTTON_IMAGE_ID:
			//pixel = pgm_read_byte(&(snakeButton[yCoord][colIndex]));
			pixel = snakeButton[yCoord][colIndex];
			break;
		case HS_MAZES_BUTTON_IMAGE_ID:
			//pixel = pgm_read_byte(&(mazesButton[yCoord][colIndex]));
			pixel = mazesButton[yCoord][colIndex];
			break;
		case SNAKE_GAME_OVER_ID:
			//pixel = pgm_read_byte(&(snakeGameOver[yCoord][colIndex]));
			pixel = snakeGameOver[yCoord][colIndex];
			break;
		case HS_BACKGROUND_IMAGE_ID:
			//address = pgm_get_far_address(homeScreenBackground[yCoord][colIndex]);
			//pixel = pgm_read_byte_far(address);
			//pixel = pgm_read_byte(&(homeScreenBackground[yCoord][colIndex]));
			pixel = homeScreenBackground[yCoord][colIndex];
			break;
		case OK_BUTTON_BC_ID:
			//pixel = pgm_read_byte(&(okButton[yCoord][colIndex]));
			pixel = okButton[yCoord][colIndex];
			break;
		case TABLE_READY_IMAGE_ID:
			//pixel = pgm_read_byte(&(tableReady[yCoord][colIndex]));
			pixel = tableReadyImage[yCoord][colIndex];
			break;
		case PAGING_USER_IMAGE_ID:
			//pixel = pgm_read_byte(&(pagingUserImage[yCoord][colIndex]));
			pixel = pagingUserImage[yCoord][colIndex];
			break;
		case OOR_IMAGE_ID:
			//pixel = pgm_read_byte(&(outOfRangeImage[yCoord][colIndex]));
			pixel = outOfRangeImage[yCoord][colIndex];
			break;
		case MAZE_SOLVED_IMAGE_ID:
			//pixel = pgm_read_byte(&(mazeSolvedImage[yCoord][colIndex]));
			pixel = mazeSolvedImage[yCoord][colIndex];
			break;
		case MG_INTRO_IMAGE_ID:
			//pixel = pgm_read_byte(&(mazeGameIntroImage[yCoord][colIndex]));
			pixel = mazeGameIntroImage[yCoord][colIndex];
			break;
		case SG_INTRO_IMAGE_ID:
			//pixel = pgm_read_byte(&(snakeGameIntroImage[yCoord][colIndex]));
			pixel = snakeGameIntroImage[yCoord][colIndex];
			break;

	}
	
	pixel &= (0x80 >> bitIndex);		// Only keep individual bit 1 if 1
	return pixel;
}


